    return (
    <div className="container-fluid">
    <div className="row w-100">
    <table>
      <Row>
      <ul>
        <li>
        <Col>
        {`${cart.dish_name}`}
        </Col>
        <Col>
        {`${cart.price}`}
        </Col>
        <Col>
        {`${cart.dish_category}`}
        </Col>
       </li>
      </ul>
        </Row>
    </table>
    </div>
    </div>
    );
}

export default AddtoCartItemOrderFood;
